- input: "TEXT\x1CC00528489\x1C.TEXT\x1C\x1CF3XA\x1CThis amendment is in response
    to your letters of 5/31/2013 regarding our 2012 Year-End and 2013 Termination
    Reports.  The committee used $939.37 in Levin funds to make a regular allocation
    transfer for expenditures reported on Schedule H4, but reported the transfer on
    Schedule H5 instead of H3.  We have amended the report to show the recharacterization
    of Levin funds as regular state funds and the subsequent transfer on Schedule
    H3.  We believe this amendment clarifies what appeared to be an overtransfer of
    Levin funds.\n"
